import React from 'react';
import {Typography} from '@mui/material/';

const CurToDo = ({toDo}) => {
  return (
    <div>
      <Typography variant="h4">{toDo.title}</Typography>
      <Typography>{toDo.body}</Typography>
    </div>

  );

};

export default CurToDo;
